import { useState } from "react";
const Greeting = () => {
  const [changeText, setChangeText] = useState(false);

  const changeTextHandler = () => {
    setChangeText(true);
  };
  return (
    <div>
      <h2>Hello world!</h2>
      <p>It's good to see you!</p>
      <button onClick={changeTextHandler}>Change Text!</button>
    </div>
  );
};

export default Greeting;
